import React from 'react';
//import { capitalizeFirstLetter } from '../../utils/helpers';

function Nav(props) {
    const {
        contactSelected,
        setContactSelected,
        aboutSelected,
        setAboutSelected
    } = props;

    return (
        <header>
            <h1>Samantha Heilman</h1>
        <nav>
            <ul className="flex-row">
                <li className={`mx-2 ${aboutSelected && 'navActive'}`}>
                    <span data-testid="about" href="#about" onClick={() => setAboutSelected(true)} {...setContactSelected(false)}>
                        About Me</span>
                </li>
                <li>
                    <a data-testid="projects" href="#projects" onClick={() => setContactSelected(false)} {...setAboutSelected(false)}>
                        Projects
                    </a>
                </li>
                <li className={`mx-2 ${contactSelected && 'navActive'}`}>
                    <span onClick={() => setContactSelected(true)} {...setAboutSelected(false)}>Contact</span>

                </li>
            </ul>
        </nav>
        </header>
    );

}

export default Nav;
